import React from 'react';

import {
    BrowserRouter as Router,
    Route, Switch, Link
  } from 'react-router-dom'
import Counter from './Counter';
  

function Navbar(){
    return(
    
    <div>
        <Switch>
            <Link to="./About.js">About</Link>
        </Switch>

        <Switch>
            <Link to="./Feedback.js">Feedback</Link>
        </Switch>


    </div>
    )
}
export default Navbar;
